marker_edge_alpha = 0.3;
marker_size = 15;

%% --- Subplot A: Seizure type comparison
nexttile; %[output:5a8218f0]
ylim([-0.5, 3.75]); %[output:5a8218f0]
set(gcf, 'Color', 'w');

all_seizures_BTCS_plotting = all_seizures;
all_seizures_BTCS_plotting.sz_type(strcmp(all_seizures_BTCS_plotting.sz_type, 'GTC')) = {'BTC'};
all_seizures_BTCS_plotting.sz_type(strcmp(all_seizures_BTCS_plotting.sz_type, 'Unparseable Epileptic Seizure')) = {'Unparseable Seizure'};

types = categories(categorical(all_seizures_BTCS_plotting.sz_type));
num_types = numel(types);
x_pos = 1:num_types;

hold on; %[output:5a8218f0]
for i = 1:num_types
    data_i = all_seizures_BTCS_plotting.preictal_aed_load(strcmp(all_seizures_BTCS_plotting.sz_type, types{i}));
    data_i = data_i(~isnan(data_i)); % remove NaNs
    if isempty(data_i), continue; end

    scatter(i + 0.1*randn(size(data_i)), data_i, marker_size, ... %[output:5a8218f0]
        'MarkerFaceColor', [0.7 0.7 0.9], 'MarkerEdgeColor','k', ... %[output:5a8218f0]
        'MarkerFaceAlpha', marker_face_alpha, 'MarkerEdgeAlpha', marker_edge_alpha); %[output:5a8218f0]

    % median line
    med = median(data_i);
    plot([i-0.15, i+0.15], [med med], 'k-', 'LineWidth', 2);

    % 95% bootstrap CI
    bootstat = bootstrp(1000, @median, data_i);
    ci = prctile(bootstat,[2.5 97.5]);
    plot([i i], [ci(1) ci(2)], 'k-', 'LineWidth', 1.5);
end

