% -------------------------------------------------------------------------

% List of predictor variables to test
predictors = {'t_first_sz', 'num_asms', 'asm_decrease'};

for i = 1:numel(predictors) %[output:group:77f59da1]
    varname = predictors{i};

    % Drop rows with NaNs in predictor
    valid_rows = ~isnan(tbl_noPNES.(varname));
    tbl_corr = tbl_noPNES(valid_rows, :);

    % Calc Pearson correlation coefficient
    R = corrcoef(tbl_corr.los, tbl_corr.(varname));
    r_val = R(1,2);

    % Calc p-value
    n = sum(valid_rows);
    t_stat = r_val * sqrt((n - 2) / (1 - r_val^2));
    p_value = 2 * (1 - tcdf(abs(t_stat), n - 2));

    % Display results
    fprintf('Pearson corr. coeff. between los and %s: %.2f\n', varname, r_val); %[output:86574fc5] %[output:9ed1b0b5] %[output:797ed9ef]
    if p_value < 0.0001
        disp('p < 0.0001') %[output:4c2a55cb] %[output:51f2b62d] %[output:2edac471]
    else
        fprintf('p = %.4f\n', p_value);
    end
end %[output:group:77f59da1]

