%[text] ## eFigure 2: Clustered Seizures analysis - univariate analysis (no PNES)
figure; %[output:823cf2ae]
hold on; %[output:823cf2ae]
set(gcf, 'Color', 'w');
marker_size =15;
marker_face_alpha = 0.3;
marker_edge_alpha = 0.3;

% X positions
x_hist_cluster    = 0.5;
x_hist_noncluster = 1.25;
x_nohist_cluster    = 2;
x_nohist_noncluster = 2.75;
all_seizures_noPNES = all_seizures(strcmp(all_seizures.sz_type,'PNES')==0,:);

% Restrict to seizures with AED load
all_sz_noPNES = all_seizures_noPNES(~isnan(all_seizures_noPNES.preictal_aed_load),:);

% Indices for cluster vs non-cluster
idx_hist_cluster    = find(all_sz_noPNES.gtcs == 1 & ...
                          (all_sz_noPNES.cluster_leader == 1 | all_sz_noPNES.clustered_sz == 1));
idx_hist_noncluster = find(all_sz_noPNES.gtcs == 1 & ...
                          (all_sz_noPNES.cluster_leader == 0 & all_sz_noPNES.clustered_sz == 0));
idx_nohist_cluster    = find(all_sz_noPNES.gtcs == 0 & ...
                            (all_sz_noPNES.cluster_leader == 1 | all_sz_noPNES.clustered_sz == 1));
idx_nohist_noncluster = find(all_sz_noPNES.gtcs == 0 & ...
                            (all_sz_noPNES.cluster_leader == 0 & all_sz_noPNES.clustered_sz == 0));

% Groups to loop
groups_idx   = {idx_hist_cluster, idx_hist_noncluster, idx_nohist_cluster, idx_nohist_noncluster};
x_positions  = [x_hist_cluster, x_hist_noncluster, x_nohist_cluster, x_nohist_noncluster];

% Updated colors: purple (clustered), orange (non-clustered)
colors = {[0.5 0 0.5], [1 0.5 0], [0.5 0 0.5], [1 0.5 0]};

% Swarm plots with narrower distribution
for i = 1:numel(groups_idx)
    data = all_sz_noPNES.preictal_aed_load(groups_idx{i})*100;
    data = data(~isnan(data));
    if isempty(data), continue; end

    % Swarm scatter with narrow jitter
    swarmchart(x_positions(i) + 0.02*randn(size(data)), data, marker_size, 'filled', ... %[output:823cf2ae]
        'MarkerFaceColor', colors{i}, 'MarkerEdgeColor','k', ... %[output:823cf2ae]
        'MarkerFaceAlpha',marker_face_alpha, 'MarkerEdgeAlpha',marker_edge_alpha); %[output:823cf2ae]

    % Median line
    med = median(data);
    plot([x_positions(i)-0.15 x_positions(i)+0.15], [med med], 'k-', 'LineWidth',2);

    % 95% bootstrap CI
    bootstat = bootstrp(1000,@median,data);
    ci = prctile(bootstat,[2.5 97.5]);
    plot([x_positions(i) x_positions(i)], [ci(1) ci(2)], 'k-', 'LineWidth',1.5);
end

set(gca,'fontsize',16); %[output:823cf2ae]
ylabel('ASM load at time of seizure (% max. baseline)'); %[output:823cf2ae]
xticks(x_positions); %[output:823cf2ae]
xticklabels({'','','',''}); %[output:823cf2ae]
ylim([0 260]); %[output:823cf2ae]

% Group labels
