text(mean([x_hist_cluster x_hist_noncluster]), y_label_pos, 'History of BTCS', ... %[output:823cf2ae]
    'HorizontalAlignment','center','FontSize',16,'FontWeight','bold'); %[output:823cf2ae]
text(mean([x_nohist_cluster x_nohist_noncluster]), y_label_pos, 'No History of BTCS', ... %[output:823cf2ae]
    'HorizontalAlignment','center','FontSize',16,'FontWeight','bold'); %[output:823cf2ae]

%% Statistical tests (mixed models)
all_sz_noPNES.ptID = categorical(all_sz_noPNES.ptID);
all_sz_noPNES.is_cluster = double(all_sz_noPNES.cluster_leader == 1 | all_sz_noPNES.clustered_sz == 1);

% History group
gtcs_mdl = fitglme(all_sz_noPNES(all_sz_noPNES.gtcs==1,:), ...
    'is_cluster ~ preictal_aed_load + (1|ptID)', ...
    'Distribution','Binomial','Link','logit');
