elseif p_hist<0.01
    text(mean([x_hist_cluster x_hist_noncluster]), y_max*1.05, '**','HorizontalAlignment','center','FontSize',14);
elseif p_hist < 0.05
    text(mean([x_hist_cluster x_hist_noncluster]), y_max*1.05, '*','HorizontalAlignment','center','FontSize',14);
else
