if p_nohist<0.001
    text(mean([x_nohist_cluster x_nohist_noncluster]), y_max*1.05, '***','HorizontalAlignment','center','FontSize',14);
elseif p_nohist<0.01
    text(mean([x_nohist_cluster x_nohist_noncluster]), y_max*1.05, '**','HorizontalAlignment','center','FontSize',14);
elseif p_nohist < 0.05
    text(mean([x_nohist_cluster x_nohist_noncluster]), y_max*1.05, '*','HorizontalAlignment','center','FontSize',14);
else
    text(mean([x_nohist_cluster x_nohist_noncluster]), y_max*1.05, 'ns','HorizontalAlignment','center','FontSize',14); %[output:823cf2ae]
end
% Legend
