h_legend(1) = plot(NaN,NaN,'o','MarkerFaceColor',[0.5 0 0.5],'MarkerEdgeColor','k','MarkerSize',6); % Purple %[output:823cf2ae]
h_legend(2) = plot(NaN,NaN,'o','MarkerFaceColor',[1 0.5 0],'MarkerEdgeColor','k','MarkerSize',6);   % Orange %[output:823cf2ae]
