% --- non-PNES (everything else) ---
isNonPNES = ~strcmp(all_seizures.sz_type, 'PNES');
numEventsNonPNES = sum(isNonPNES);
numPtsNonPNES = numel(unique(all_seizures.ptID(isNonPNES)));

% --- PNES patients ---
isPNES = strcmp(all_seizures.sz_type, 'PNES');
ptsPNES = unique(all_seizures.ptID(isPNES));

% --- non-PNES patients ---
isNonPNES = ~strcmp(all_seizures.sz_type, 'PNES');
ptsNonPNES = unique(all_seizures.ptID(isNonPNES));

% --- patients with both PNES and non-PNES ---
ptsBoth = intersect(ptsPNES, ptsNonPNES);
numPtsBoth = numel(ptsBoth);
%---
numPtsPNESonly    = numel(setdiff(ptsPNES, ptsBoth));
numPtsNonPNESonly = numel(setdiff(ptsNonPNES, ptsBoth));

